import React from 'react';
import './App.css';

function App() {
  const [data, setData] = React.useState(null);

  React.useEffect(() => {
    fetch("/questions")
    .then((res) => res.json())
    .then((data) => setData(data));
  })
  return (
    <div className="App">
      <div className='questions'>
        <p>
          {data[0].question}
        </p>
        <p>
          {data[0].correct}
        </p>
        <p>
          {data[0].alphaincorrect}
        </p>
        <p>
          {data[0].bravoincorrect}
        </p>
        <p>
          {data[0].charlieincorrect}
        </p>
        </div>
    </div>
  );
}

export default App;
